import {React,useState,useEffect} from "react";
import { getData } from "../services/dataService";
import {Table} from "react-bootstrap"
export default function ShowData()
{
    const [bids,setBids]=useState("");
    const [asks,setAsks]=useState("");
    const [start,setStart]=useState(true);
    useEffect(()=>{
        async function fetchData()
        {try
            {
                const res =await getData();
                console.log(res)
                setBids(res["bids"]);
                setAsks(res["asks"]);
                debugger;
                console.log(bids);
                console.log(asks);
                setStart(false);
            }
            catch(e)
            {
                setBids([]);
            }
            

        }     
     fetchData();
    },[])
    if (start)
    return(<div>hello</div>) 
else
    return(
     <Table striped bordered hover>
         <thead>
          <tr>
          <th>BTC-USD</th>
         </tr>
         <tbody>
             <tr>
             <thead>
          <tr>
          <th>bid qty</th>
          <th>bid price</th>
         </tr>
        </thead>
              
         {bids.map(bid=>
          <tr>
            <td>{bid[1]}</td>
            <td>{bid[0]}</td>
           </tr>
           )}
             </tr>
             <tr>
             <thead>
          <tr>
          <th>ask qty</th>
          <th>ask price</th>
         </tr>
        </thead>
          
         {asks.map(ask=>
          <tr>
            <td>{ask[1]}</td>
            <td>{ask[0]}</td>
           </tr>
           )}
            </tr>
         </tbody>
        </thead>
       
     </Table>
    )
}
